function recaptchaCallback(code) {

    $('form[data-recaptcha] button[type=submit]').prop("disabled", false);


    const inputs = $('form[data-recaptcha] input[type=text], form input[type=email], form textarea').filter(function () {
        return $(this).val() === '';
    });

    if (inputs.length > 0) {
        inputs.get(0).focus();
    } else {
        $('form[data-recaptcha]').submit();
    }
}

if ($('#settings-page').length > 0) {

    // Password
    $('input:password').pwstrength({
        ui: {
            showPopover: true,
            showErrors: true,
        },
        common: {
            usernameField: '#email'
        }
    });

    // Browser alert permissions
    const $checkbox = $('#browser-alerts');

    $checkbox.on('click', function () {
        if ($(this).is(':checked')) {

            Push.Permission.request(
                function () {
                },
                function () {
                    alert('You have denied notification access in your browser.');
                    $(this).prop("checked", false);
                }
            );
        }
    });

    // Data tables
    $('#events table.table-datatable2').DataTable($.extend(true, {}, dtDefaultOptions, {
        "order": [[0, 'desc']],
        "columnDefs": [
            // Time
            {
                "targets": 0,
                "render": function (data, type, row) {
                    return '<span data-toggle="tooltip" data-placement="left" title="' + row[1] + '" data-livestamp="' + row[0] + '">' + row[1] + '</span>';
                },
                "createdCell": function (td, cellData, rowData, row, col) {
                    $(td).attr('nowrap', 'nowrap');
                },
                "orderable": false
            },
            // Type
            {
                "targets": 1,
                "render": function (data, type, row) {
                    return '<i class="fas ' + row[7] + '"></i> ' + row[2];
                },
                "createdCell": function (td, cellData, rowData, row, col) {
                    $(td).attr('nowrap', 'nowrap');
                },
                "orderable": false
            },
            // IP
            {
                "targets": 2,
                "render": function (data, type, row) {

                    if (row[3] === row[6]) {
                        return '<span class="font-weight-bold" data-toggle="tooltip" data-placement="left" title="Your current IP">' + row[3] + '</span>';
                    }
                    return row[3];
                },
                "orderable": false
            },
            // User Agent
            {
                "targets": 3,
                "render": function (data, type, row) {
                    // return row[4];
                    return '<span data-toggle="tooltip" data-placement="left" title="' + row[4] + '">' + row[5] + '</span>';
                },
                "createdCell": function (td, cellData, rowData, row, col) {
                    //$(td).attr('nowrap', 'nowrap');
                },
                "orderable": false
            }
        ]
    }));
}

if ($('#stats-page').length > 0) {

    const columnDefaults = {
        chart: {
            type: 'column'
        },
        title: {
            text: ''
        },
        subtitle: {
            text: ''
        },
        credits: {
            enabled: false
        },
        legend: {
            enabled: false
        },
        xAxis: {
            title: {
                text: ''
            },
            type: 'category'
        },
        yAxis: {
            title: {
                text: ''
            }
        },
        series: [{
            color: '#28a745',
        }],
        plotOptions: {
            series: {
                pointPadding: 0,
                groupPadding: 0,
            }
        }
    };

    $.ajax({
        type: "GET",
        url: '/stats/app-scores',
        success: function (data, textStatus, jqXHR) {


            Highcharts.chart('scores', $.extend(true, {}, columnDefaults, {
                xAxis: {
                    tickInterval: 5,
                },
                tooltip: {
                    formatter: function () {
                        return this.y + ' apps have ' + this.x + '/100';
                    },
                },
                plotOptions: {
                    series: {
                        cursor: 'pointer',
                        point: {
                            events: {
                                click: function () {
                                    window.location.href = '/games?score-low=' + this.x + '&score-high=' + (this.x + 1);
                                }
                            }
                        }
                    }
                },
                series: [{
                    data: data
                }]
            }));
        },
        dataType: 'json'
    });

    $.ajax({
        type: "GET",
        url: '/stats/app-types',
        success: function (data, textStatus, jqXHR) {

            Highcharts.chart('types', $.extend(true, {}, columnDefaults, {
                xAxis: {
                    labels: {
                        rotation: -20,
                    }
                },
                tooltip: {
                    formatter: function () {
                        return this.y + ' ' + this.key + ' apps';
                    },
                },
                plotOptions: {
                    series: {
                        cursor: 'pointer',
                        point: {
                            events: {
                                click: function () {
                                    console.log(this);
                                    window.location.href = '/games?types=' + (this.name.toLowerCase());
                                }
                            }
                        }
                    }
                },
                series: [{
                    data: data,
                    dataLabels: {
                        enabled: true,
                        formatter: function () {
                            return this.y.toLocaleString();
                        }
                    }
                }]
            }));
        },
        dataType: 'json'
    });

    $.ajax({
        type: "GET",
        url: '/stats/ranked-countries',
        success: function (data, textStatus, jqXHR) {

            Highcharts.chart('countries', $.extend(true, {}, columnDefaults, {
                xAxis: {
                    tickInterval: 1,
                },
                tooltip: {
                    formatter: function () {
                        return this.y + ' ' + this.key + ' players';
                    },
                },
                series: [{
                    data: data,
                    dataLabels: {
                        enabled: true,
                        formatter: function () {
                            return this.y.toLocaleString();
                        }
                    }
                }]
            }));
        },
        dataType: 'json'
    });
}

if ($('#upcoming-page').length > 0) {

    // Setup datatable
    $('table.table').DataTable($.extend(true, {}, dtDefaultOptions, {
        "order": [[3, 'desc']],
        "createdRow": function (row, data, dataIndex) {
            $(row).attr('data-id', data[0]);
            $(row).attr('data-link', data[3]);
        },
        "columnDefs": [
            // Icon / Name
            {
                "targets": 0,
                "render": function (data, type, row) {
                    return '<img src="' + row[2] + '" class="rounded square"><span>' + row[1] + '</span>';
                },
                "createdCell": function (td, cellData, rowData, row, col) {
                    $(td).addClass('img');
                    $(td).attr('data-app-id', rowData[0]);
                },
                "orderable": false
            },
            // Type
            {
                "targets": 1,
                "render": function (data, type, row) {
                    return row[4];
                },
                "orderable": false
            },
            // Price
            {
                "targets": 2,
                "render": function (data, type, row) {
                    return row[5];
                },
                "orderable": false
            },
            // Release Date
            {
                "targets": 3,
                "render": function (data, type, row) {
                    return '<span data-livestamp="' + row[7] + '"></span>';
                },
                "orderable": false
            }
        ]
    }));
}
